import React from 'react';
import logo from '../../assets/logo.png';
import * as style from './Header.css';

const header = () => {
    return (        
      <div className={style.Header}>
        <div className={style.logo}>
            <img src={logo} alt="logo"/>
        </div>
      </div>
    );
}

export default header;
